package com.sqisoft.iqs.pf.vo;

public class EmplVO {
	private String empl_id;
	private String team_id;
	private String pj_id;
	private int empl_div;
	private int empl_cost;
	public EmplVO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public EmplVO(String empl_id, String team_id, String pj_id, int empl_div,
			int empl_cost) {
		super();
		this.empl_id = empl_id;
		this.team_id = team_id;
		this.pj_id = pj_id;
		this.empl_div = empl_div;
		this.empl_cost = empl_cost;
	}
	public String getEmpl_id() {
		return empl_id;
	}
	public void setEmpl_id(String empl_id) {
		this.empl_id = empl_id;
	}
	public String getTeam_id() {
		return team_id;
	}
	public void setTeam_id(String team_id) {
		this.team_id = team_id;
	}
	public String getPj_id() {
		return pj_id;
	}
	public void setPj_id(String pj_id) {
		this.pj_id = pj_id;
	}
	public int getEmpl_div() {
		return empl_div;
	}
	public void setEmpl_div(int empl_div) {
		this.empl_div = empl_div;
	}
	public int getEmpl_cost() {
		return empl_cost;
	}
	public void setEmpl_cost(int empl_cost) {
		this.empl_cost = empl_cost;
	}
	@Override
	public String toString() {
		return "EmplVO [empl_id=" + empl_id + ", team_id=" + team_id
				+ ", pj_id=" + pj_id + ", empl_div=" + empl_div
				+ ", empl_cost=" + empl_cost + "]";
	}
	
	
}
